import React from "react";
import { Link } from "react-router-dom";
import styles from "./styles.module.css";

const Home = () => {
  // Sample movie data
  const movies = [
    {
      id: "1",
      name: "Baby (Telugu)",
      rating: "4",
      image: "https://www.filmibeat.com/img/190x100x237/popcorn/movie_posters/baby-20230711172441-21800.jpg",
    },
    {
      id: "2",
      name: "Oppenheimer (English)",
      rating: "4.2",
      image: "https://sportshub.cbsistatic.com/i/2023/05/05/75a5162e-60b8-4bf4-9902-3c0ef49af85f/oppenheimer-poster-cillian-murphy.jpg?auto=webp&width=1500&height=2375&crop=0.632:1,smart",
    },
    {
      id: "3",
      name: "Barbie (2023)",
      rating: "3.5",
      image: "https://example.com/barbie_2023.jpg",
    },
    {
      id: "4",
      name: "Bro (Telugu)",
      rating: "4.5",
      image: "https://example.com/bro_telugu.jpg",
    },
    {
      id: "5",
      name: "Rocky aur Rani (Hindi)",
      rating: "2.5",
      image: "https://example.com/rocky_aur_rani_hindi.jpg",
    },
  ];

  return (
    <div className={styles.homeContainer}>
      <h1 className={styles.appName}>Movie Club</h1>
      <div className={styles.movieList}>
        {movies.map((movie) => (
          <Link to={`/movie/${movie.id}`} key={movie.id} className={styles.movieItem}>
            <img src={movie.image} alt={movie.name} className={styles.movieImage} />
            <h3 className={styles.movieName}>{movie.name}</h3>
            <p className={styles.movieRating}>Rating: {movie.rating}</p>
          </Link>
        ))}
      </div>
    </div>
  );
};

export default Home;

